import React from "react";
import pizzaHurt from '../components/PizzaHurt';

let pizzaHut = () =>{
    return(
        <React.Fragment>
            <div className="container">
                <div className="row">
                    <div className="col">
                        <p className="h3 text-danger">PizzaHUt</p>
                        <p className="lead">this is new pizza order in  the store and explore new life</p>
                        
                    </div>
                </div>
            </div>
            
        </React.Fragment>
    )
}
export default pizzaHurt;
